impl Solution {
    pub fn minimum_sum(nums: Vec<i32>) -> i32 {
        let mut left_min = vec![std::i32::MAX; nums.len()];
        let mut right_min = vec![std::i32::MAX; nums.len()];
        let mut min_sum = std::i32::MAX;

        for i in 1..nums.len() {
            left_min[i] = left_min[i - 1].min(nums[i - 1]);
        }

        for i in (0..nums.len() - 1).rev() {
            right_min[i] = right_min[i + 1].min(nums[i + 1]);
        }

        for j in 1..nums.len() - 1 {
            if nums[j] > left_min[j] && nums[j] > right_min[j] {
                min_sum = min_sum.min(nums[j] + left_min[j] + right_min[j]);
            }
        }

        if min_sum == std::i32::MAX {
            -1
        } else {
            min_sum
        }
    }
}
